import React from 'react'
import '../Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function head(){
    return (
      <div class="container" >
        <div class="row ">
          <div class="col-lg-12 col-md-12 col-sm-12">
            <div>
              <div id="Logar">
                <p style={{fontWeight:"bold"}}>Quem somos</p>
              </div>
              <div className="botaoLogin">
                <a href="/">
                  <button id="botaoLogin">logar</button>
                </a> 
              </div>
            </div>
          </div>
        </div>
      </div>
        
    );
}

export default head;
